r($,"b6z","aCD",()=>A.a([A.lm("\u2022\tEducational Focus: Interactive trails with hands-on activities, history storytelling, and quizzes to engage students in learning about Kozhikode\u2019s past in a fun, structured way.\n\t\u2022\tStops: Historical landmarks, cultural sites, museums, and monuments with educational materials tailored for children and teens.\n\t\u2022\tGoal: To provide an immersive learning experience that aligns with school curricula on history, culture, and environmental studies.","School Heritage Trails"),A.lm("\u2022\tRomantic & Scenic Focus: Trails highlighting scenic spots, peaceful locations, and romantic backdrops. Ideal for couples looking to experience Kozhikode\u2019s charm together.\n\t\u2022\tStops: Seaside paths, historic architecture with beautiful settings, quieter temples or gardens, and picturesque viewpoints.\n\t\u2022\tGoal: To create a memorable experience where couples can explore the beauty of Kozhikode\u2019s heritage in a relaxed, intimate atmosphere.","Couple Trails"),A.lm("\u2022\tFamily-Friendly Focus: Trails that are designed for multi-generational groups, offering a mix of activities that children, parents, and grandparents can enjoy together.\n\t\u2022\tStops: Easy-to-navigate paths with a mix of history, nature, and cultural experiences, including parks, local markets, and safe play areas.\n\t\u2022\tGoal: To provide an enjoyable day for families to learn and bond over Kozhikode\u2019s heritage, with stops for snacks and breaks.","Family Trails"),A.lm("\u2022\tCultural Immersion Focus: Trails that dive deep into Kozhikode\u2019s unique culture, history, and traditions, providing foreign visitors with a complete introduction to the city.\n\t\u2022\tStops: Key historical sites, spice markets, cultural centers, and local food tasting spots. Audio guides in multiple languages can enhance the experience.\n\t\u2022\tGoal: To give tourists a comprehensive view of Kozhikode\u2019s history, from ancient trade routes to local traditions, ensuring they leave with a rich understanding of the city.","Foreign Tourist Trails"),A.lm("\u2022\tComfort & Accessibility Focus: Gentle-paced trails with minimal walking and seated areas, designed to accommodate older visitors who may need breaks and easy access.\n\t\u2022\tStops: Heritage sites with benches or shaded areas, brief walking tours near resting places, and accessible museums or temples.\n\t\u2022\tGoal: To make heritage exploration comfortable and enjoyable for seniors, with guides trained to cater to their pace and interests.","Senior Citizens\u2019 Trails"),A.lm("\u2022\tExploration Focus: Trails that include lesser-known heritage spots, rugged paths, and off-the-beaten-track locations for a more adventurous experience.\n\t\u2022\tStops: Ancient ruins, hidden temples, unexplored pathways, and natural trails through Kozhikode\u2019s scenic surroundings.\n\t\u2022\tGoal: To offer thrill-seekers a unique heritage experience that combines history with an element of exploration and discovery.","Adventure Enthusiasts\u2019 Trails"),A.lm("\u2022\tVisual Aesthetics Focus: Trails featuring photogenic spots and historic architecture, catering to people who want to capture the beauty of Kozhikode.\n\t\u2022\tStops: Vibrant marketplaces, ancient architecture, traditional crafts centers, and scenic viewpoints.\n\t\u2022\tGoal: To provide photo enthusiasts with unique, visually appealing spots, highlighting Kozhikode\u2019s charm and vibrant culture.","Photography & Art Lover Trails"),A.lm("\u2022\tFood & Culture Focus: A trail for food lovers that combines heritage with culinary exploration, allowing participants to sample local delicacies.\n\t\u2022\tStops: Historic eateries, spice markets, cooking demonstrations, and tasting spots for traditional Malabar cuisine.\n\t\u2022\tGoal: To offer a sensory journey through Kozhikode\u2019s rich food heritage, showcasing flavors and culinary history.","Culinary Heritage Trails"),A.lm("\u2022\tNature and Heritage Integration Focus: For visitors who want to experience Kozhikode\u2019s natural beauty while learning about its heritage.\n\t\u2022\tStops: Nature trails, mangroves, riverside paths, and eco-friendly heritage sites.\n\t\u2022\tGoal: To merge nature with history, offering a relaxing and educational experience that highlights Kozhikode\u2019s environmental and cultural heritage.","Eco & Nature Lovers\u2019 Trails"),A.lm("\u2022\tMindful Exploration Focus: Trails designed for those interested in spiritual and wellness experiences, with stops at sacred and peaceful locations.\n\t\u2022\tStops: Temples, mosques, churches, meditation spots, and wellness centers with a historical or spiritual significance.\n\t\u2022\tGoal: To provide an opportunity for introspection and tranquility while exploring Kozhikode\u2019s spiritual heritage.","Spiritual & Wellness Trails")],A.a0("r<Ke>")))
r($,"b6A","aCC",()=>A.a([A.tF("\u2022\tAccessibility Focus: Specifically designed to accommodate differently-abled visitors, ensuring ease of navigation, comfort, and engagement for people with mobility, visual, hearing, or cognitive disabilities.\n\t\u2022\tStops: Wheelchair-accessible paths, audio-guided stations, tactile exhibits, and sites equipped with ramps, railings, and accessible restrooms.\n\t\u2022\tGoal: To create a barrier-free experience that enables everyone to explore Kozhikode\u2019s heritage in a comfortable, dignified, and engaging way.\n\nKey Features:\n\n\t\u2022\tWheelchair-Friendly Routes: Ensure smooth, paved paths with ramps, wide doorways, and minimal obstacles.\n\t\u2022\tVisual and Audio Guides: Include braille signs, audio guides, and tactile exhibits for the visually impaired.\n\t\u2022\tSign Language Guides or Video Captions: Provide interpreters or captions for hearing-impaired visitors at select locations.\n\t\u2022\tRest Areas: Regular, accessible rest spots to support physical comfort and reduce fatigue.\n","Accessible Heritage Trails"),A.tF("\u2022\tCalm and Controlled Environment Focus: Created for those who may find crowded or noisy spaces overwhelming, this trail includes quieter areas and sensory-friendly stops with a slower pace.\n\t\u2022\tStops: Scenic spots, calm temples or meditation areas, nature paths with gentle sounds, and spaces designed to minimize sensory overload.\n\t\u2022\tGoal: To provide an inclusive experience for visitors with sensory sensitivities, allowing them to explore heritage in a serene, accessible environment.","Sensory-Friendly Trails"),A.tF("\u2022\tPersonalized Assistance Focus: Trained guides accompany small groups, catering to individual needs, including providing descriptive narration for the visually impaired or assistance with movement.\n\t\u2022\tStops: Sites with seating, accessible viewing areas, and adjustable tour length options based on visitor comfort.\n\t\u2022\tGoal: To offer a fully supported and inclusive experience, providing each visitor with a comfortable and enjoyable heritage tour.","Guided Heritage Trails with Personalized Support"),A.tF("\u2022\tHands-On Engagement Focus: Trails designed with tactile exhibits and interactive elements, such as touchable artifacts or models, to offer a multi-sensory experience.\n\t\u2022\tStops: Museums or cultural centers with artifact replicas, model displays, and accessible workshops that encourage hands-on learning.\n\t\u2022\tGoal: To enable differently-abled visitors, particularly those with visual impairments, to explore heritage through touch, sound, and interaction.","Interactive & Tactile Heritage Trails"),A.tF("\u2022\tNature and Heritage Focus with Accessibility: Incorporating nature trails that are wheelchair-accessible, with features like sensory gardens or accessible waterfront paths.\n\t\u2022\tStops: Scenic and natural spots with ramps, tactile garden elements, and accessible rest areas to combine nature with heritage exploration.\n\t\u2022\tGoal: To allow differently-abled visitors to experience Kozhikode\u2019s natural beauty and heritage while ensuring accessibility and safety.","Inclusive Nature and Heritage Trails"),A.tF("\u2022\tAll-Inclusive Family Focus: Suitable for families with differently-abled members, ensuring all family members can enjoy the trail together.\n\t\u2022\tStops: Accessible paths, interactive displays, seating for breaks, and spaces with activities for children.\n\t\u2022\tGoal: To create an inclusive family experience, making Kozhikode\u2019s heritage enjoyable for every member, regardless of ability.","Family-Friendly & Inclusive Heritage Trails"),A.tF("\u2022\tDigital Experience Focus: A virtual tour that allows differently-abled individuals who may not be able to visit in person to experience Kozhikode\u2019s heritage sites digitally.\n\t\u2022\tStops: High-quality virtual walkthroughs, audio descriptions, and interactive digital displays of key heritage sites.\n\t\u2022\tGoal: To offer a fully accessible, immersive heritage experience from anywhere, making Kozhikode\u2019s rich history and culture available to everyone.","Virtual Heritage Trail")],A.a0("r<Kd>")))
